import config from '@/config';
import Generator from '@/webApi/generator'
export default new Generator({
     //表单数据
     GetAppInfoList: {url: '/appInfoService/GetAppInfoList', method: 'post'},
     // 部署列表数据
     GetOrganiztionList: {url: '/appInfoService/GetOrganiztionList', method: 'post'},

     // 激活信息启动/禁用
     UpdateDeleteStatus: {url: '/appInfoService/UpdateDeleteStatus', method: 'post'},
     // 获取下载链接
     GetAppXMLDownLoadUrl: {url: '/appInfoService/GetAppXMLDownLoadUrl', method: 'post'},
     // 新增/修改生产激活信息
     SubmitAppInfo: {url: '/appInfoService/SubmitAppInfo', method: 'post'},
     // 获取生产激活明细
     GetAppInfoById: {url: '/appInfoService/GetAppInfoById', method: 'post'},

}, config.pgyerApiUrl);
